import React from 'react';
import { Link } from 'react-router-dom';

const HallList = ({ halls }) => {
  return (
    <div className="hall-list">
      <h2>Halls</h2>
      <ul>
        {halls.map((hall) => (
          <li key={hall._id}>
            <Link to={`/halls/edit/${hall._id}`}>{hall.name}</Link>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default HallList;
